export class CreateTicketComponent {
    constructor(dialogRef, cheetaTicketService, cheetaUserService, fileUploader, dialog, data) {
        this.dialogRef = dialogRef;
        this.cheetaTicketService = cheetaTicketService;
        this.cheetaUserService = cheetaUserService;
        this.fileUploader = fileUploader;
        this.dialog = dialog;
        this.data = data;
